const Custos = ({ notas }) => {
  let nNotas = [];
  console.log(notas[0]);
  for (let i = 0; i < notas.lenght; i++) {
    console.log(notas[i]);
    nNotas.push(notas[i]);
  }

  return (
    <div>
      {nNotas.map((nota) => (
        <p>nota.corretora</p>
      ))}
    </div>
  );
};

export default Custos;
